import React, {useContext} from 'react';
import { ContextApi } from '../ContextApi';

function Setting() {
    const { lang, setLang } = useContext(ContextApi);
    console.log(lang, 'lang setting');
  return (
    <div>
      <div className="container">
        <div className="row">
          <h1>語言</h1>
          <div>
            <button type="button" className="btn btn-outline-dark btn-sm" onClick={()=>setLang('en')}>
              中文
            </button>
            <button type="button" className="btn btn-outline-dark btn-sm m-1" onClick={()=>setLang('en')}>
              英文
            </button>
          </div>

          <h1>主題</h1>
          <div>
            <button type="button" className="btn btn-outline-dark btn-sm">
              淺色
            </button>
            <button type="button" className="btn btn-outline-dark btn-sm m-1">
              深色
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Setting;
